import "./App.css";
import { PokemonList } from "./components/PokemonList";
import { PokemonDetails } from "./components/PokemonDetails";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Switch>
      <div className="App"> 
          <Route path="/" element={<PokemonList />} />

      </div>
    </Switch>
  );
}

export default App;
